import { useEffect, useState } from "react";
import { getAllClasses } from "../../services/classService";
import "./Classes.css";

const MemberClasses = () => {
  const [classes, setClasses] = useState([]);

  const loadClasses = async () => {
    try {
      const res = await getAllClasses();
      setClasses(res.data.data || []);
    } catch (err) {
      console.error("Failed to load classes", err);
      setClasses([]);
    }
  };

  useEffect(() => {
    loadClasses();
  }, []);

  return (
    <div className="fq-classes-root">
      <h2>Class Schedule</h2>

      <div className="fq-class-grid">
        {classes.map((c) => (
          <div key={c._id} className="fq-class-card">
            <h4>{c.name}</h4>
            <p>Trainer: {c.trainer?.name}</p>
            <p>Specialization: {c.trainer?.specialization}</p>
            <p>Date: {new Date(c.date).toLocaleDateString()}</p>
            <p>Time: {c.time}</p>
            <p>Duration: {c.duration} mins</p>
          </div>
        ))}
      </div>

      {classes.length === 0 && (
        <p className="fq-empty-text">No classes scheduled yet.</p>
      )}
    </div>
  );
};

export default MemberClasses;
